import React from "react";
import { Field, ErrorMessage } from "formik";
import TextError from "../../TextError";
import {
  Box,
  Checkbox,
  FormControlLabel,
  FormGroup,
  FormLabel,
  Paper,
} from "@material-ui/core";
import { useStyles } from "./styles";

function CheckboxGroup(props) {
  const { label, name, options, error } = props;
  const classes = useStyles();
  // console.log("error.touched TypeLenseigne", error.touched.TypeLenseigne);
  // console.log("error.values TypeLenseigne", error.values.TypeLenseigne);
  // console.log("error.touched offre", error.touched.offre);
  // console.log("error.values offre", error.values.offre);

  let getErrorEns = error.touched?.TypeLenseigne ? true : false;
  let getErrorValEns = error?.touched?.TypeLenseigne?.length >= 1 ? true : false;
  let getErroroffre = error.touched?.offre ? true : false;
  let getErrorValoffre = error?.touched?.offre?.length >= 1 ? true : false;

  // console.log('getErrorEns', error.touched?.TypeLenseigne)
  // console.log('getErrorValEns', getErrorValEns)

  // let errorEns = getErrorEns && getErrorValEns ? true : false
  // let errorOffre = getErroroffre && getErrorValoffre ? true : false

  //  console.log('errorEns', errorEns)
  //  console.log('errorOffre', errorOffre)

  let colorr = error.touched?.TypeLenseigne  && error?.value?.TypeLenseigne?.length > 1 ? '#d77' : '#000'
  return (
    <Box className={classes.containercheckbox}>
      <FormLabel
        component="legend"
        style={{ fontWeight: "800", color:colorr,  paddingBottom: 10 }}
      >
        {label}
      </FormLabel>
      {options.map((option) => {
        return (
          <Box className={classes.item}>
            <Field type="checkbox" name={name} value={option.value} />
            <FormLabel className={classes.textLabel}>{option.value}</FormLabel>
          </Box>
        );
      })}
      <ErrorMessage component={TextError} name={name} />
    </Box>
  );
}

export default CheckboxGroup;
